import React from 'react';
import { Card } from 'semantic-ui-react'
import VideoThumbnail from 'react-video-thumbnail';

export default class Projects extends React.Component{

    render(){
        const src = 'https://www.ideveloppement.fr/application/uploads/resources/barney_fond_bleu/barney-ideveloppement-bleu-600.png'
        return(
            <div>
                <div class="projectsheader">
                <h1 class="projectsheader">Projects___</h1> 
                </div>
                <div class="projectContainer">
                <Card.Group itemsPerRow={3}>
                    <Card color='red' image={<VideoThumbnail
                videoUrl="https://www.youtube.com/watch?v=B3vyGw7uwo8"
                thumbnailHandler={(thumbnail) => console.log(thumbnail)}
                width={120}
                height={80}
                />} />
                    <Card color='orange' image={src} />
                    <Card color='yellow' image={src} />
                </Card.Group>
                </div>

            </div>
        )
    }
}
